# (전체 데이터를 넣으시면 됩니다. 여기서는 예시로 0번과 1번만 포함했습니다.)
# 실제 사용시에는 user님이 주신 텍스트 전체를 raw_data_str에 넣으세요.

def parse_input_string(data_str):
    mazes = {}
    lines = data_str.strip().split('\n')
    for line in lines:
        if not line.strip(): continue
        try:
            idx_str, list_str = line.split(':', 1)
            idx = int(idx_str.strip())
            edge_list = ast.literal_eval(list_str.strip())
            mazes[idx] = edge_list
        except:
            continue
    return mazes

# 2. 트리 변환 로직
def edges_to_tree(edges, grid_width=4):
    adj = {i: [] for i in range(grid_width * grid_width)}
    for u, v in edges:
        adj[u].append(v)
        adj[v].append(u)

    root_node = {'id': 0, 'type': 2, 'children': []}
    queue = [(root_node, -1, (0, 1))] 
    visited = set([0])

    while queue:
        curr_obj, parent_id, current_dir = queue.pop(0)
        curr_id = curr_obj['id']
        curr_r, curr_c = divmod(curr_id, grid_width)
        dr, dc = current_dir

        for neighbor in adj[curr_id]:
            if neighbor == parent_id: continue
            if neighbor in visited: continue

            visited.add(neighbor)
            next_r, next_c = divmod(neighbor, grid_width)
            nr, nc = next_r - curr_r, next_c - curr_c
            
            node_type = 2
            type_char = 'S'
            if (nr, nc) == (dr, dc):
                node_type = 2; type_char = 'S'
            elif (nr, nc) == (-dc, dr):
                node_type = 1; type_char = 'L'
            elif (nr, nc) == (dc, -dr):
                node_type = 3; type_char = 'R'

            child_obj = {
                'id': neighbor,
                'type': node_type,
                'type_char': type_char,
                'children': []
            }
            curr_obj['children'].append(child_obj)
            queue.append((child_obj, curr_id, (nr, nc)))

    return root_node

# 3. 데이터 처리 및 저장
mazes_data = parse_input_string(raw_data_str)
processed_trees = {}
