# 4. 시각화 및 이미지 저장
def save_tree_visualization(tree_root, filename, grid_width=4):
    G = nx.Graph()
    pos = {}
    labels = {}
    
    queue = [tree_root]
    while queue:
        node = queue.pop(0)
        uid = node['id']
        r, c = divmod(uid, grid_width)
        pos[uid] = (c, -r)
        
        label_text = node.get('type_char', 'Root')
        labels[uid] = f"{uid}\n({label_text})"
        
        ntype = node['type']
        if uid == 0: color = 'lightgreen'
        elif ntype == 1: color = '#ff9999' # Left
        elif ntype == 2: color = '#99ccff' # Front
        elif ntype == 3: color = '#99ff99' # Right
        else: color = 'white'
        
        G.add_node(uid, color=color)
        for child in node['children']:
            G.add_edge(uid, child['id'])
            queue.append(child)
            
    plt.figure(figsize=(10, 10))
    node_colors = [nx.get_node_attributes(G, 'color')[n] for n in G.nodes()]
    
    nx.draw(G, pos, with_labels=True, labels=labels,
            node_color=node_colors, node_size=600, font_size=8, edge_color='gray')
            
    plt.title(f"Maze Tree Visualization (Saved: {filename})")
    plt.grid(True, linestyle=':', alpha=0.3)
    plt.axis('equal')
    
    # [수정] show() 대신 savefig() 사용
    plt.savefig(filename)
    plt.close() # 메모리 해제
    print(f"Visualization saved to '{filename}'")

# 실행
if 0 in processed_trees:
    save_tree_visualization(processed_trees[0], 'maze_tree_0_44.png')